// HasFiles applies the HasEdge predicate on the "files" edge.
func HasFiles() predicate.StorageStrategy {
	return predicate.StorageStrategy(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, FilesTable, FilesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasFilesWith applies the HasEdge predicate on the "files" edge with a given conditions (other predicates).
func HasFilesWith(preds ...predicate.File) predicate.StorageStrategy {
	return predicate.StorageStrategy(func(s *sql.Selector) {
		step := newFilesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.StorageStrategy) predicate.StorageStrategy {
	return predicate.StorageStrategy(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.StorageStrategy) predicate.StorageStrategy {
	return predicate.StorageStrategy(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.StorageStrategy) predicate.StorageStrategy {
	return predicate.StorageStrategy(sql.NotPredicates(p))
}
